The most effective optimization is a good register allocator. The first step is converting the program into static single assignment form (SSA). Then for each assignment, determine its "value number". This is a hash of the operation and value numbers of the operands. Assignments with the same value number produce the same value, so they can be combined. This is called "global value numbering". Finally, you can use graph coloring to assign registers to the remaining value numbers.
