function mergeArrays(arr1, arr2) {
  const result = [];

  // Loop through each element in arr1
  for (let i = 0; i < arr1.length; i++) {
    let obj1 = arr1[i];

    // Check if there is an object with same stepId and fieldId in arr2
    let foundObj2 = false;
    for (let j = 0; j < arr2.length; j++) {
      let obj2 = arr2[j];
      if (obj1.stepId === obj2.stepId && obj1.fieldId === obj2.fieldId) {
        foundObj2 = true;
        break;
      }
    }

    // If no matching object was found in arr2, add obj1 to result array
    if (!foundObj2) {
      result.push(obj1);
    } else {
      // Otherwise, check if message property exists in either object
      if (obj1.message || obj2.message) {
        // Add object with message property from first object if available, otherwise use second object
        result.push({
          stepId: obj1.stepId,
          fieldId: obj1.fieldId,
          message: obj1.message ? obj1.message : obj2.message
        });
      } else {
        // If neither object has a message property, set it to empty string
        result.push({
          stepId: obj1.stepId,
          fieldId: obj1.fieldId,
          message: ""
        });
      }
    }
  }

  return result;
}

